testcases = int(input())
while testcases:
    [N, M] = list(map(int, input().split()))
    topics = list(map(int, input().split()))
    num_set = set()
    for val in topics:
        num_set.add(val)
    req_sum = M * (M + 1) // 2
    curr_sum = 0
    for val in num_set:
        curr_sum += val
    if req_sum - curr_sum != 0:
        print('Yes')
    else:
        print('No')
    testcases -= 1

